  input: 'TEXT,"F3A","","This amendment is in response to your letter dated March
    5.  We have amended disbursements to federal candidates to include the office,
    state and district they are seeking.  We will be refunding 500$ to Roy Goldman
    and Stephen Thomas.  We will also be refunding 3000$ to the American Medical Association
    PAC. Clerical errors caused these contributions to be accepted.  We have now rectified
    the errors.  The refunds will appear on our next report. The following is our
    procedure for our best efforts in obtaining missing information for contributors.:  In
    original solicitation, we request the contributor''s information clearly and conspicuously,
    stating that federal law requires us to use our best efforts to obtain their address,
    occupation and employer if they give an aggregate of $200 to the committee.  If
    for some reason we do not receive this information, we send a follow-up request
    within 30 days again stating that we are required to use our best efforts to obtain
    their address, occupation and employer.  Our follow-up request contains no new
    soliciations and includes a pre-addressed return envelope.  If we receive contributor
    information after the contribution has been reported, we will either file with
    our next reports, an amended memo schedule A listing the additional information
    or file on or before our next regularly scheduled reporting date amendments to
    the original report."'
